import React from "react";

const http = require("https");

const options = {
  method: "GET",
  hostname: "netflix54.p.rapidapi.com",
  port: null,
  path: "/search/?query=stranger&offset=0&limit_titles=50&limit_suggestions=20&lang=en",
  headers: {
    "x-rapidapi-key": "6eb69c2aa1mshddf27456becc191p108768jsn5185fd3a034a",
    "x-rapidapi-host": "netflix54.p.rapidapi.com",
  },
};
let arr = [];
const req = http.request(options, function (res) {
  const chunks = [];

  res.on("data", function (chunk) {
    chunks.push(chunk);
  });

  res.on("end", function () {
    const body = Buffer.concat(chunks);
    arr = body.toString("utf-8");
  });
});

req.end();

export default arr;
